\u0412\u043e\u043f\u0440\u043e\u0441 9.\u041a\u043e\u043c\u043c\u0435\u043d\u04:
Так искусствовед объясняет, почему знаменитая картина черно-белая;
голубь, послуживший для Пикассо символом мира, на этой картине изображен
в состоянии паники.

\u0412\u043e\u043f\u0440\u043e\u0441 12.\u041a\u043e\u043c\u043c\u0435\u043d\u04:
Туман движется к герою через озеро против ветра, что несколько странно;
косой парус позволяет кораблям до определенной степени двигаться против
ветра.
